$.tabs=function(a,b){$(a).each(function(b,c){$($(c).attr("rel")).css("display","none"),$(c).click(function(){$(a).each(function(a,b){$(b).removeClass("selected"),$($(b).attr("rel")).css("display","none")}),$(this).addClass("selected"),$($(this).attr("rel")).css("display","block")})}),b||(b=$(a+":first").attr("rel")),$(a+"[rel='"+b+"']").trigger("click")};